import React from 'react';
import '../css/Submenu.css';

class LinkedAccountsMenu extends React.Component {

    render() {
        return (
            <div>
                <div className="BtnContainer">
                    <div className="SubmenuBtn">Link Account</div>
                </div>                
            </div>

        );
    }
}

export default LinkedAccountsMenu;
